response.about:
Провожу консультации, на которых вы сможете осознать причинно-следственные связи по индивидуальному запросу и:
проработать травмирующие ситуации, ограничивающие убеждения и ваши страхи;
пережить и принять потерю близких;
просканировать своё тело и понять о чём оно хочет вам рассказать;
улучшить и гармонизировать отношения с окружением.
